import React, { Component } from 'react';
import {Table} from "react-bootstrap"

import 'bootstrap/dist/css/bootstrap.min.css';




class PageListagem extends Component {



  render() {
    return (
      <>
        <ul className="list-group">
          {this.props.pessoas.map((pessoa, index) => {
            return (
              <li align="center" className="list-group-item" key={index}>
                {index + " =>" + " Email: " + pessoa.email + " Senha: " + `${pessoa.senha}`}
              </li>
            )
          })}
        </ul>

        <Table striped bordered hover>
          <thead>
            <tr>
              <th>#</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Username</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
            <tr>
              <td>2</td>
              <td>Jacob</td>
              <td>Thornton</td>
              <td>@fat</td>
            </tr>
            <tr>
              <td>3</td>
              <td colSpan={2}>Larry the Bird</td>
              <td>@twitter</td>
            </tr>
          </tbody>
        </Table>
      </>


    )
  }
}

export default PageListagem;
